const InputField = ({value, setValue, nameKey, type, invalidField, setInvalidField}) => {
  return (
    <div>
        <input
        type={type || 'text'}
        placeholder={nameKey?.slice(0,1).toUpperCase() + nameKey?.slice(1)}
        value={value}
        className='bo'
        ></input>
    </div>
  )
}

